class Urls():
    def __init__(self):
        self.urls = urls

    def get(self,name):
        query = name.lower()
        for u in urls:
            name = u["name"].lower()
            name_no_ext = name.split('.')[0]
            if query == name or query == name_no_ext:
                return u
    @property
    def random(self):
        return random.choice(self.urls)
